import React from "react"
import {
  NavLink,  
 } 
 from "react-router-dom";

function Home () {
    return (
      <div>
        <h2>BE THE CHANGE 
		YOU WANT TO SEE
		IN THE WORLD</h2>
		<h3>Discover the potential of knowledge and experience sharing.
Join the community of people whose main objective is helping others 
in disclosing their potential driving to personal success </h3>

        <p>WHY YOU SHOULD BECOME A MENTEE</p>
        <li><NavLink to="/members">Find mentors</NavLink></li>
        <li><NavLink to="/">Perform tasks</NavLink></li>
        <li><NavLink to="/members">Be discovered</NavLink></li>
        <li><NavLink to="/profile">Forge your CV</NavLink></li>


      </div>


    )
  }


export default Home
